import styled from "styled-components";

const Root = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: whitesmoke;
  height: 100vh;
  width: 100vw;
`;

const DataWrapper = () => {
  return <Root></Root>;
};

export default DataWrapper;
